import React from 'react';
import BtnRegistro from './BtnRegistro';
import { Link } from 'react-router-dom';
import "./Navbar.scss";

import QuikenLogo from '../../assets/Inicio/Quiken_Logo_color-03.svg'

const Navbar = () => {
  return (
    <>
      <div className="navbar-main">
        <div className="navbar-logo-placeholder">
          <img src={QuikenLogo} className="quiken-logo" />
        </div>

        {/* //Desktop Menu */}
        <div className="navbar-links-wrapper">
          <Link className="navbar-link"to="/">INICIO</Link>
          <Link className="navbar-link" to="/servicios">SERVICIOS</Link>
          <Link className="navbar-link" to="/fulfillment">FULFILLMENT</Link>
          <Link className="navbar-link" to="/rastreo">RASTREO</Link>
          <Link className="navbar-link" to="/contacto">CONTACTO</Link>
          <Link className="navbar-link" to="/signin">
            SIGN IN
          </Link>
          <Link to="/signup">
            <BtnRegistro/>
          </Link>
        </div>
        {/* Mobile Menu */}
        <Burger/>
        <Menu/>



      </div>
    </>
  );
};

const Menu = ({ open }) => {
  return (
    <StyledMenu open={open}>
      <a href="/">
        <span role="img" aria-label="about us">üíÅüèª‚Äç‚ôÇÔ∏è</span>
        About us
      </a>
      <a href="/">
        <span role="img" aria-label="price">üí∏</span>
        Pricing
        </a>
      <a href="/">
        <span role="img" aria-label="contact">üì©</span>
        Contact
        </a>
    </StyledMenu>
  )
}

const StyledMenu = styled.nav`
  display: flex;
  flex-direction: column;
  justify-content: center;
  background: #EFFFFA;
  transform: ${({ open }) => open ? 'translateX(0)' : 'translateX(-100%)'};
  height: 100vh;
  text-align: left;
  padding: 2rem;
  position: absolute;
  top: 0;
  left: 0;
  transition: transform 0.3s ease-in-out;

  @media (max-width: 576px) {
      width: 100%;
    }

  a {
    font-size: 2rem;
    text-transform: uppercase;
    padding: 2rem 0;
    font-weight: bold;
    letter-spacing: 0.5rem;
    color: #0D0C1D;
    text-decoration: none;
    transition: color 0.3s linear;

    @media (max-width: 576px) {
      font-size: 1.5rem;
      text-align: center;
    }

    &:hover {
      color: #343078;
    }
  }
`

const StyledBurger = styled.button`
  position: absolute;
  top: 5%;
  left: 2rem;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  width: 2rem;
  height: 2rem;
  background: transparent;
  border: none;
  cursor: pointer;
  padding: 0;
  z-index: 10;

  &:focus {
    outline: none;
  }

  div {
    width: 2rem;
    height: 0.25rem;
    background: ${({ open }) => open ? '#0D0C1D' : '#EFFFFA'};
    border-radius: 10px;
    transition: all 0.3s linear;
    position: relative;
    transform-origin: 1px;

    :first-child {
      transform: ${({ open }) => open ? 'rotate(45deg)' : 'rotate(0)'};
    }

    :nth-child(2) {
      opacity: ${({ open }) => open ? '0' : '1'};
      transform: ${({ open }) => open ? 'translateX(20px)' : 'translateX(0)'};
    }

    :nth-child(3) {
      transform: ${({ open }) => open ? 'rotate(-45deg)' : 'rotate(0)'};
    }
  }
`

const Burger = ({ open, setOpen }) => {
  return (
    <StyledBurger open={open} onClick={() => setOpen(!open)}>
      <div />
      <div />
      <div />
    </StyledBurger>
  )
}

export default Navbar
